Fine Art Collection

Arts Documentary hosted by Dilly Barlow and Leslie Megahey, published by BBC in 2003 - English narration


Information
------------------------------

The original art is a human desire, depicting life through a variety of ways, but who are the masters of it? The expression means they must be unique individuals, while also embracing life. &quot;Art Collection&quot; by the BBC performs elaborate and time-consuming search through the years, shuttling around the museums, galleries and private collections in the world and visiting around artists friends and family. It is also showing enjoyment through the creation of classics, interspersed with an introduction to the life of the great masters of art from various periods to gain insight into their artistic core.

7)  The Mysteries of Hieronymus Bosch 
Hieronymus Bosch (1450-1516)
Nicholas Baum travels to Holland, Spain and Portugal in search of clues to the nightmare paintings of this 15th-century artist. Over the years, his works have been interpreted in terms of heresy, alchemy, drugs and witchcraft, and one theory is that Bosch was a member of a secret sect which practised orgies. His works are unconventional interpretations of conventional subjects, that are intended to act as a terrible warning against sinning.

